//import the images
import img1 from './images/Cardiology.svg'
import img2 from './images/Gastroenterology.svg'
import img3 from './images/Haematology.svg'
import img4 from './images/Nephrology.svg'
import img5 from './images/speciality.png'

 export const data = [
    {
        id:1,
        image:img1,
        special:"Cardiology",
    },
    {
        id:2,
        image:img2,
        special:"Gastroenterology",
    },
    {
        id:3,
        image:img3,
        special:"Haematology",
    },
    {
        id:4,
        image:img4,
        special:"Nephrology",
    },
    {
        id:5,
        image:img5,
        special:"Neurology",
    },
    {
        id:6,
        image:img5,
        special:"Oncology"
    }
];

